import './App.css';
import Home from './components/Home';
import About from './components/About';
import CreateStudent from './components/crud/estudent/CreateStudent';
import ListStudent from './components/crud/estudent/ListStudent';
import EditStudent from './components/crud/estudent/EditStudent';


import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import { Routes, Route, Link } from "react-router-dom";


function App() {
  return (
    <div className="container">
     <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
     <Link to={"/"} className="navbar-brand">
       UFC
       </Link>
       <div className="collapse navbar-collapse" id="navbarSupportedContent">
         <ul className="navbar-nav mr-auto">
            <li className="navitem">
            <Link to="/" className="nav-link">Home</Link>
            </li>

            <li className="navitem">
            <Link to="about" className="nav-link">About</Link>
            </li>
            <li className="navitem">
            <Link to="createStudent" className="nav-link">Create Student</Link>
            </li>
            <li className="navitem">
            <Link to="listStudent" className="nav-link">List Student</Link>
            </li>

         </ul>
       </div>

     </nav>
    <Routes>
      <Route path='/' element= {<Home />} />
      <Route path='about' element= {<About />} />
      <Route path='createStudent' element= {<CreateStudent />} />
      <Route path='listStudent' element= {<ListStudent />} />
      <Route path='editStudent:' element= {<EditStudent />} />
    </Routes>
    </div>
  );
}

export default App;
